import React from 'react'

export default function TesteFullData( {PokemonFullData}) {
    console.log("aqui", PokemonFullData)
    return (
        <div>
            asd
            {PokemonFullData.map((Pokemon) => (
              <div>
                  <h2>{Pokemon.name}</h2>
                  <h4>{Pokemon.data.base_experience}</h4> 
                  </div> 
            ))}
        </div>
    );
}
